// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

import "./Dagora.sol";

contract TestDagora is Dagora {

    constructor(address _arbitrator,
                address _token,
                uint _reportTimeout,
                uint _feeTimeout,
                bytes memory _reportExtraData,
                bytes memory _orderExtraData,
                string memory _ipfsDomain)
                Dagora(_arbitrator,
                        _token,
                        _reportTimeout,
                        _feeTimeout,
                        _reportExtraData,
                        _orderExtraData,
                        _ipfsDomain) public {
    }

    function _validateListing(bytes32 hash, Listing memory _listing, Sig memory sig)
        public
        view
        returns (bool)
    {
        return validateListing(hash, _listing, sig);
    }

    function _hashListing(Listing memory listing)
        public
        pure
        returns (bytes32 hash)
    {
        return hashListing(listing);
    }
}
